import "./landing.css";
import { motion } from "framer-motion";

export default function Landing() {
  return (
    <div className="banner">
      <div className="banner-content">
        <motion.div>
          <div className="banner-text">
            <h1>WELCOME TO</h1>
            <h1>Rooster Grin</h1>
            <a href="#learnMore">
              <button>Learn More</button>
            </a>
          </div>
        </motion.div>
      </div>
    </div>
  );
}

